import React, { useEffect, useRef, useState } from "react";
import io from "socket.io-client";
import Peer from "simple-peer";
import "./Room.css";

const SERVER_URL = process.env.REACT_APP_SERVER_URL || "https://192.168.29.23:5000";

const Room = () => {
  const [peers, setPeers] = useState([]);
  const [participants, setParticipants] = useState([]);
  const socketRef = useRef();
  const userVideo = useRef();
  const peersRef = useRef([]);
  const roomID = sessionStorage.getItem("room");
  const userName = sessionStorage.getItem("name");

  useEffect(() => {
    socketRef.current = io(SERVER_URL);
    navigator.mediaDevices.getUserMedia({ video: true, audio: true }).then((stream) => {
      userVideo.current.srcObject = stream;

      socketRef.current.emit("join room", { roomID, userName });

      socketRef.current.on("all users", (users) => {
        const peers = [];
        users.forEach(({ id, name }) => {
          const peer = createPeer(id, socketRef.current.id, stream);
          peersRef.current.push({ peerID: id, peer, name });
          peers.push({ peerID: id, peer, name });
        });
        setPeers(peers);
      });

      socketRef.current.on("user joined", ({ signal, callerID, name }) => {
        const peer = addPeer(signal, callerID, stream);
        peersRef.current.push({ peerID: callerID, peer, name });
        setPeers((users) => [...users, { peerID: callerID, peer, name }]);
      });

      socketRef.current.on("receiving returned signal", ({ id, signal }) => {
        const item = peersRef.current.find(p => p.peerID === id);
        item?.peer.signal(signal);
      });

      socketRef.current.on("update user list", (list) => {
        setParticipants(list);
      });

      socketRef.current.on("user left", (id) => {
        const peerObj = peersRef.current.find(p => p.peerID === id);
        if (peerObj) peerObj.peer.destroy();
        peersRef.current = peersRef.current.filter(p => p.peerID !== id);
        setPeers(peers => peers.filter(p => p.peerID !== id));
      });
    });
  }, []);

  function createPeer(userToSignal, callerID, stream) {
    const peer = new Peer({ initiator: true, trickle: false, stream });
    peer.on("signal", signal => {
      socketRef.current.emit("sending signal", { userToSignal, callerID, signal, name: userName });
    });
    return peer;
  }

  function addPeer(incomingSignal, callerID, stream) {
    const peer = new Peer({ initiator: false, trickle: false, stream });
    peer.on("signal", signal => {
      socketRef.current.emit("returning signal", { signal, callerID });
    });
    peer.signal(incomingSignal);
    return peer;
  }

  return (
    <div className="roomContainer">
      <div className="header">Ve Meet</div>
      <div className="videoGrid">
        <div className="videoBlock">
          <video ref={userVideo} autoPlay muted playsInline className="video" />
          <div className="nameTag">{userName} (Host)</div>
        </div>
        {peers.map(({ peerID, peer, name }) => (
          <Video key={peerID} peer={peer} name={name} />
        ))}
      </div>
      <div className="sidebar">
        <div className="participantCount">Participants: {participants.length}</div>
        <ul>
          {participants.map((name, index) => (
            <li key={index}>{name}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

const Video = ({ peer, name }) => {
  const ref = useRef();
  useEffect(() => {
    peer.on("stream", stream => {
      ref.current.srcObject = stream;
    });
  }, [peer]);

  return (
    <div className="videoBlock">
      <video playsInline autoPlay ref={ref} className="video" />
      <div className="nameTag">{name}</div>
    </div>
  );
};

export default Room;
